84腰掛防災トイレは災害時だけではなく日常使いにも便利。<br>
普段使っており踏み台や腰掛がいざという時に防災トイレに変身！！<br>
<br>
・玄関におけば靴ひもらくらく！<br>
・台所や居間でちょこっと休憩に！<br>
・軽くて移動もらくらく<br>
<br>
■緊急時にはトイレとして使用！<br>
中フタを取り外し45Lのゴミ袋を穴の内側から天板を覆うようにセットすることで、一人ひとり清潔に使用できます。<br>
身近にある新聞紙をくしゃくしゃに丸め中に入れると吸収シートの代わりになります。<br>
※中に入れるのはペットシートや猫砂でもＯＫです。<br>
<br>
また、45Lゴミ袋の2枚の底を切りトンネル状にテープで接着し下水道マンホールや便槽の上に84防災トイレを置き天板を覆うように取り付けマンホールの中にゴミ袋の下部を入れ
使用することもできます。<br>
<br>
●組み立てサイズ<br>
　横幅300×奥行き360×高さ340mm<br>
<br>
●お届け箱サイズ<br>
　横310mm×奥行370mm×高さ360mm<br>
（組み立て済で配送）<br>
<br>
●カラー<br>
　無地<br>
<br>
