簡易トイレは災害時の必需品です。<br><br>
<font color="#006699" size="2">
逆さにしてもこぼれない逆流防止タイプ</font>
<br><br>
携帯トイレ・GOODパック（ミニタイプ）<br>
大容量1000cc<br>
受け口：ウレタン<br>
袋：ポリエチレン<br>
吸水材：吸水ポリマー<br>
サイズ：140×340mm<br>
<br>
レジャー＆災害対策に最適!!<br>
携帯用トイレとしてOK！<br>
車の渋滞時に、乗り物酔いのエチケット袋として。<br>
<br>
◆ポリマーで瞬間硬化→ポリマーが瞬間に液体をジェルに硬化し、漏れを防ぎ臭いもカット。<br>
◆逆流二重構造→筒状の本体は、逆流防止機能付きの二重構造。汚物を漏らしません。<br>
◆丈夫なポリエチレン製→本体は丈夫なポリエチレンを使用し、携帯にもかさばらず、簡単に破れる事はありません。<br>
◆ソフトな入れ口→注入口は、柔らかな発泡性ポリウレタンでカバー。使用時の違和感や不快感がありません。<br>
◆ご使用後は可燃ゴミとして廃棄できます。<br>
(財)東京都中小企業振興公社「ニューマーケット事業」支援製品<br>
レジャー＆災害対策<br><br><img src="http://image.rakuten.co.jp/be-kan/cabinet/tel.jpg"><style type="text/css">
